import React from "react";

const projects = [];

const Projects = () => {

  return projects.length ? (
    <section className="projects-section">
      { projects.map(project => (
        <h3>{ project.title }</h3>
      ))}
    </section>
  ) : (
    <section>
      <p>Projects are coming soon!</p>
    </section>
  );
}

export default Projects;
